const CartPage = () => {
    const [cart, setCart] = useCart()
    const [auth, setAuth] = useAuth()
    const navigate = useNavigate();
  return (
    <Layout> 
        <div className="container">
            <div className="row">
                <div className="col-md-12">
                    <h1 className="text-center bg-light p-2">
                        {`Hello ${auth?.token && auth.token.user.name}`}
                    </h1>
                </div>
            </div>
        </div>
    </Layout> 
  )
}

